import React from 'react';
import AppBar from '@material-ui/core/AppBar';

const topnav = () => (
    <AppBar position="static" style={{marginLeft: "12vw", backgroundColor:"white", maxWidth:"50%"}}>
        <h4 style={{color:"grey"}}>Dashboard</h4>
    </AppBar>
)
export default topnav;
